import React from 'react';
import './Home.css'
import Kaibot from '../Kaibot.png'
import { Link } from 'react-router-dom'

function Home() {
  return (
    <div className='home' onDragStart={event => event.preventDefault()}>
      <div className='btn-container'>
        <Link to={{
          pathname: '/commands'
        }}>
          <button className='commands'>
            2020-11-18
          </button>
        </Link>
      </div>
    </div>
  );
}

export default Home;
